// generate maze
const generate = (x, y) => {
  let n = x * y - 1;
  const horiz = []; for (var j= 0; j<x+1; j++) horiz[j]= [];
  const verti = []; for (var j= 0; j<y+1; j++) verti[j]= [];
  let here = [Math.floor(Math.random()*x), Math.floor(Math.random()*y)];
  const path = [here];
  const unvisited= [];
  for (var j= 0; j<x+2; j++) {
    unvisited[j] = [];
    for (var k= 0; k<y+1; k++) {
      unvisited[j].push(j>0 && j<x+1 && k>0 && (j != here[0]+1 || k != here[1]+1));
    }
  }
  while (0 < n) {
    const potential= [
      [here[0]+1, here[1]], [here[0],here[1]+1],
      [here[0]-1, here[1]], [here[0],here[1]-1]
    ];
    const neighbors= [];
    for (var j= 0; j < 4; j++) {
      if (unvisited[potential[j][0]+1][potential[j][1]+1]) {
        neighbors.push(potential[j]);
      }
    }
    if (neighbors.length) {
        n = n-1;
        next= neighbors[Math.floor(Math.random()*neighbors.length)];
        unvisited[next[0]+1][next[1]+1]= false;
        if (next[0] === here[0]) {
          horiz[next[0]][(next[1]+here[1]-1)/2] = true;
        } else {
          verti[(next[0]+here[0]-1)/2][next[1]] = true;
        }
        path.push(here = next);
    } else { 
      here = path.pop();
    }
  }
  const maze = [];
  for (var j = 0; j<x*2+1; j++) {
    const line= [];
    if (0 === j%2) {
      for (var k=0; k<y*4+1; k++) {
        if (0 === k%4) {
          line[k] = true;
        } else {
          line[k] = !(j>0 && verti[j/2-1][Math.floor(k/4)]);
        }
      }
    } else {
      for (var k=0; k<y*4+1; k++) {
        if (0 === k%4) {
          line[k] = !(k>0 && horiz[(j-1)/2][k/4-1]);
        } else {
          line[k] = false;
        }
      }
    }
    if (0 == j) line[1]=line[3]=line[2]= false;
    //if (x*2-1 == j) line[4*y] = false;
    maze.push(line, line, line);
  }
  return maze;
}

reset();
const maze = generate(7, 11);
const offset = {
  x: Math.floor(maze[0].length * -0.5),
  z: Math.floor(maze.length * -0.5),
};
maze.forEach((lines, z) => lines.forEach((wall, x) => {
  for (var y = 0; y < 6 + Math.random() * 3; y += 1) {
  	let type = y < 2 || wall ? 1 : 0;
    if (wall && y === 5 && Math.random() < 0.03) {
     type = 2;
    }
    update(offset.x + x, y, offset.z + z, type);
  }
}));

const elevator = {
  x: 15,
  y: 0,
  z: 19,
};
box(
  elevator.x, elevator.y, elevator.z,
  8, 9, 8,
  1
);
box(
  elevator.x + 1, elevator.y + 1, elevator.z + 1,
  6, 7, 6,
  3
);
box(
  elevator.x + 2, elevator.y + 2, elevator.z + 2,
  4, 5, 4,
  0
);
box(
  elevator.x + 3, elevator.y + 2, elevator.z,
  2, 4, 2,
  0
);
